INSERT INTO `articles` (`id`, `enable`, `title`, `url`, `image`, `fullimage`, `desc`, `text`, `created_at`, `updated_at`) VALUES
(1, 1, 'Как полюбить себя', 'kak-polyubit-sebya-1', 'pic15634413804f31337513709b113aa9563840b8eae7.jpg', 'pic15634413816d1b2a10b80d5cbb1341ecd9a469470e.jpg', 'Мы расскажем, как полюбить себя сильнее и сделать счасливее.', '<p style=\"margin:0cm 0cm 8pt; margin-right:0cm; margin-left:0cm\"><u><em><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span style=\"font-family:Calibri,sans-serif\"><b><span style=\"font-size:18.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Поиcкать точку G</span></span></span></b></span></span></span></span></em></u></p>\r\n\r\n<p style=\"margin:0cm 0cm 8pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:11pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Обычно женщины стимулируют клитор&nbsp;&mdash; это самый верный и&nbsp;быстрый способ доставить себе удовольствие.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Но&nbsp;клитор&nbsp;&mdash; это не&nbsp;только крошечный бугорок в&nbsp;вульве. Большая его часть (ножки клитора) скрывается внутри. Найти его основание несложно&nbsp;&mdash; нужно накрыть ладонью лобок, запустить палец внутрь и&nbsp;максимально его согнуть. Он&nbsp;упрется в&nbsp;переднюю стенку влагалища в&nbsp;нескольких сантиметрах от&nbsp;входа.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Новый опыт&nbsp;&mdash; новые ощущения. И&nbsp;потом ты&nbsp;сможешь легко объяснить и&nbsp;показать партнеру путь к&nbsp;твоему оргазму, если он&nbsp;вдруг заблудится.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"margin-left:0cm;margin-right:0cm;margin:0cm 0cm 8pt;\"><u><em><span style=\"background:white;\"><span style=\"line-height:24.0pt;\"><span style=\"font-family:Calibri,sans-serif;\"><b><span style=\"color:black;\">Сменить позицию</span></b></span></span></span></em></u></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Скучно всегда заниматься сексом в&nbsp;одной позиции. Совершенно так&nbsp;же может наскучить и&nbsp;секс с&nbsp;самой собой, просто потому что он&nbsp;всегда одинаковый.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Попробуй что-то новенькое: разные позы позволят стимулировать себя под разными углами, а&nbsp;тело наполнится предвкушением. Можно, к&nbsp;примеру, сесть на&nbsp;корточки, лечь на&nbsp;живот, делать это стоя, вытянув одну ногу на&nbsp;спинку дивана.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"margin-left:0cm;margin-right:0cm;margin:0cm 0cm 8pt;\"><u><em><span style=\"background:white;\"><span style=\"line-height:24.0pt;\"><span style=\"font-family:Calibri,sans-serif;\"><b><span style=\"color:black;\">Свести ноги вместе</span></b></span></span></span></em></u></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Хотя, казалось&nbsp;бы, сделать все следует с&nbsp;точностью до&nbsp;наоборот: развести бедра в&nbsp;сторону, выгнуть спину.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Но, если в&nbsp;момент, близкий к&nbsp;сладкой кульминации, сжать ноги, можно получить еще больше приятных ощущений. Дело в&nbsp;том, что таким образом ты&nbsp;просто увеличиваешь площадь стимуляции собственной вульвы.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"margin-left:0cm;margin-right:0cm;margin:0cm 0cm 8pt;\"><u><em><span style=\"background:white;\"><span style=\"line-height:24.0pt;\"><span style=\"font-family:Calibri,sans-serif;\"><b><span style=\"color:black;\">Не&nbsp;забывать о&nbsp;прелюдии</span></b></span></span></span></em></u></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Если занимаешься сексом одна&nbsp;&mdash; это не&nbsp;повод пропустить прелюдию. Прими ванну с&nbsp;ароматическими маслами, сделай себе массаж. Погладь свои бедра и&nbsp;грудь так, как это сделал&nbsp;бы партнер.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Твое внимание не&nbsp;обязано сосредотачиваться на&nbsp;одной лишь вульве. Тело&nbsp;&mdash; большое, и&nbsp;на&nbsp;нем есть масса других эрогенных зон, стимулируя которые, лучше подготовишь себя к&nbsp;кульминации удовольствия.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"margin-left:0cm;margin-right:0cm;margin:0cm 0cm 8pt;\"><u><em><span style=\"background:white;\"><span style=\"line-height:24.0pt;\"><span style=\"font-family:Calibri,sans-serif;\"><b><span style=\"color:black;\">Создать игривое настроение</span></b></span></span></span></em></u></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Ты&nbsp;наверняка знаешь, что можно упустить оргазм, отвлекшись на&nbsp;какую-то мелочь. Ну&nbsp;и&nbsp;вообще для того, чтобы получить разрядку, нужно подходящее настроение. Так вот, заведи себе какой-нибудь ритуал, который будет помогать настроиться на&nbsp;сеанс любви с&nbsp;самой собой.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Это может быть эротический фильм, книга или что-то другое. Главное&nbsp;&mdash; чтобы ты&nbsp;могла использовать эти стимулы в&nbsp;любой момент, когда тебе только захочется.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"margin-left:0cm;margin-right:0cm;margin:0cm 0cm 8pt;\"><u><em><span style=\"background:white;\"><span style=\"line-height:24.0pt;\"><span style=\"font-family:Calibri,sans-serif;\"><b><span style=\"color:black;\">Выбрать игрушку</span></b></span></span></span></em></u></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Если ты&nbsp;все еще живешь в&nbsp;том веке, когда под &laquo;секс-игрушкой&raquo; подразумевался резиновый фаллоимитатор, спешим тебя обрадовать! Сейчас эротических товаров стало так много, что можно провести не&nbsp;один отпуск, пробуя&nbsp;их.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Есть игрушки для стимуляции только клитора. Есть&nbsp;те, что воздействуют и&nbsp;на&nbsp;точку&nbsp;G, а&nbsp;есть много чего и&nbsp;для ануса. Не&nbsp;стесняйся пробовать и&nbsp;выбрать для себя самое лучшее.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"margin-left:0cm;margin-right:0cm;margin:0cm 0cm 8pt;\"><u><em><span style=\"background:white;\"><span style=\"line-height:24.0pt;\"><span style=\"font-family:Calibri,sans-serif;\"><b><span style=\"color:black;\">Носить секс-игрушку с&nbsp;собой</span></b></span></span></span></em></u></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Некоторые из&nbsp;них такие крошечные и&nbsp;беззвучные, что можно их&nbsp;носить в&nbsp;сумочке или прикрепить к&nbsp;белью и&nbsp;использовать в&nbsp;любое время дня и&nbsp;в&nbsp;любом месте, а&nbsp;не&nbsp;только дома вечером под одеялом. К&nbsp;слову о&nbsp;разнообразии, да.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Учитывая, что многие игрушки управляются дистанционно с&nbsp;помощью мобильного приложения, мастурбацию можно превратить в&nbsp;захватывающую игру для двоих. Например, партнер может запускать устройство, когда подумал о&nbsp;тебе.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Договоритесь, правда, чтобы этого не&nbsp;произошло, когда ты&nbsp;будешь на&nbsp;важной встрече.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm 0cm 8pt; margin-right:0cm; margin-left:0cm\">&nbsp;</p>', '2019-07-27 07:34:28', '2019-07-29 17:34:36'),
(2, 1, '8 тайн мастурбации', '8-tayn-masturbacii-2', 'pic1563441380a6189c4b5a063183fecf2c3fc45039bf.jpg', 'pic15634413816d1b2a10b80d5cbb1341ecd9a469470e.jpg', 'Если о сексе говорить уже более-менее начали — в тематических сообществах, с подругами, а некоторые еще и с психотерапевтами и сексологами, — то о мастурбации продолжают молчать.', '<p style=\"margin:0cm 0cm 8pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:11pt\"><span style=\"line-height:107%\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:15.0pt\"><span style=\"background:white\"><span style=\"line-height:107%\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Если о сексе говорить уже более-менее начали &mdash; в тематических сообществах, с подругами, а некоторые еще и с психотерапевтами и сексологами, &mdash; то о мастурбации продолжают молчать.</span></span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span style=\"font-family:&quot;Calibri Light&quot;,sans-serif\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><b><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Что вообще делаешь &laquo;это&raquo;</span></span></b></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Тему мастурбации почти не&nbsp;поднимают люди, которые находятся в&nbsp;отношениях. Во-первых, считается, что партнер должен полностью закрывать потребности в&nbsp;сексе: если я&nbsp;делаю это сам с&nbsp;собой, значит секс у&nbsp;нас так себе.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Во-вторых, никогда не&nbsp;знаешь, как воспримет этот факт любимый человек. &laquo;Тебе меня мало, что&nbsp;ли?&raquo;&nbsp;&mdash; и&nbsp;начнет сомневаться, хороший&nbsp;ли он&nbsp;любовник.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Ну&nbsp;и, в-третьих, мастурбация&nbsp;&mdash; действительно интимное действо, которое помогает погружаться в&nbsp;фантазии, о&nbsp;которых не&nbsp;хочется говорить даже самому близкому человеку. Это еще и&nbsp;быстрый способ снять напряжение и&nbsp;получить удовольствие.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Наконец, это секс, полностью посвященный только себе. Неудивительно, что (без преувеличения) все люди время от&nbsp;времени это делают. И&nbsp;не&nbsp;считают нужным делиться этим секретом с&nbsp;другими.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span style=\"font-family:&quot;Calibri Light&quot;,sans-serif\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><b><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Как именно делаешь &laquo;это&raquo;</span></span></b></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Если&nbsp;бы удовольствие себе можно было&nbsp;бы доставить себе только при помощи рук! В&nbsp;ход идут и&nbsp;насадки для душа, и&nbsp;симпатичные (а&nbsp;иногда и&nbsp;жутковатые на&nbsp;вид) секс-игрушки, и&nbsp;самые немыслимые предметы мебели, и&nbsp;даже виды продуктов (например, как в&nbsp;фильме &laquo;Американский пирог&raquo;)...</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Женщинам иногда достаточно просто напрячь мышцы бедер, чтобы получить миотонический оргазм.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">В&nbsp;общем, способы мастурбации иногда бывают довольно странными. Поэтому &laquo;про это&raquo; и&nbsp;не&nbsp;расскажешь никому, не&nbsp;прослыв извращенцем. Все-все, умолкаем и&nbsp;мы.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span style=\"font-family:&quot;Calibri Light&quot;,sans-serif\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><b><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Как часто делаешь &laquo;это&raquo;</span></span></b></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Потому что норма у&nbsp;всех разная: кому-то нравится уединяться раз в&nbsp;неделю, кому-то&nbsp;&mdash; по&nbsp;паре раз на&nbsp;дню. Человек с&nbsp;высокой половой конституцией с&nbsp;трудом поймет того, чей темперамент гораздо ниже. Лучше помалкивать&nbsp;&mdash; так наверняка можно избежать сравнений и&nbsp;навешивания ярлыков вроде &laquo;сексуальный маньяк&raquo; или &laquo;фригидная ханжа&raquo;.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span style=\"font-family:&quot;Calibri Light&quot;,sans-serif\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><b