(3, 1, '5 способов рассказать  партнеру о своих  эротических фантазиях', '5-sposobov-rasskazat-partneru-o-svoih-eroticheskih-fantaziyah-3', 'pic1563441379fa4058e45417f17947a6550eb2580122.jpg', 'pic15634413816d1b2a10b80d5cbb1341ecd9a469470e.jpg', 'Знаниями о том, как рассказать о своей сексуальной фантазии партнеру, делится эксперт и тренер центра семейного и сексуального образования Secrets Виктория Бастрыкина.', '<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">По&nbsp;данным Центра семейного и&nbsp;сексуального образования Secrets, нереализованные сексуальные фантазии имеют примерно&nbsp;75% мужчин и&nbsp;92% женщин. Смотря на&nbsp;эту статистику, ты&nbsp;можешь подумать, что мужчины фантазируют реже, чем женщины. Но скорее такой процент обусловлен тем, что мужчины оказываются более смелыми в&nbsp;отношении реализации своих желаний.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Например, 90% мужчин мечтают о&nbsp;глубоком оральном сексе. И в&nbsp;общем-то нам как женщинам странной эта фантазия не&nbsp;кажется, ведь один из&nbsp;самых популярных тренингов в&nbsp;любом центре сексуального образования&nbsp;&mdash; оральный, где учат эту фантазию воплощать.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">А&nbsp;вот у&nbsp;женщин на&nbsp;первом месте фантазии совершенно другие&nbsp;&mdash; секс с&nbsp;героем кинофильма, или секс втроем, о&nbsp;сексе с&nbsp;женщиной тоже мечтает достаточно большое количество женщин. Но&nbsp;надо понимать, что удовлетворение всех этих фантазий может нести в&nbsp;себе разочарование и&nbsp;возникновение последующих сложностей в&nbsp;отношениях с&nbsp;партнером. Есть и&nbsp;другой пласт женских фантазий, более невинных&nbsp;&mdash; ролевые игры, применение в&nbsp;сексе элементов БДСМ, использование секс-игрушек.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span style=\"font-family:&quot;Calibri Light&quot;,sans-serif\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><b><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Почему важно говорить</span></span></b></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Разговоры о&nbsp;фантазиях и&nbsp;желаниях зачастую воспринимаются обоими партнерами очень болезненно, так как всем нам свойственно искать недостатки именно в&nbsp;себе, и&nbsp;когда наша вторая половинка заявляет, что хочет попробовать что-то новое, мы&nbsp;подсознательно уже уверены в&nbsp;том, что мы&nbsp;вовсе не&nbsp;хороши в&nbsp;постели.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Но&nbsp;может возникнуть вопрос: зачем вообще рассказывать партнеру о&nbsp;своих фантазиях, если это может ранить его или заставить замкнуться в&nbsp;себе? Нереализованные сексуальные фантазии, если они достаточно сильны, могут отразиться на&nbsp;сексуальной жизни, стать навязчивыми идеями.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Поэтому мы&nbsp;бы рекомендовали поступать с&nbsp;фантазиями, которые требуют реализации, следующим образом: в&nbsp;первую очередь необходимо взвесить все &laquo;за&raquo; и &laquo;против&raquo; и&nbsp;решить для себя, хотим&nbsp;ли мы&nbsp;воплощать эту фантазию ради ее&nbsp;воплощения, или за&nbsp;этим желанием кроется что-то еще, при необходимости можно даже проконсультироваться со&nbsp;специалистом; во&nbsp;вторую очередь следует приступить непосредственно к&nbsp;реализации.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Необходимо продумать свою фантазию до&nbsp;мелочей: например, за&nbsp;фантазией о&nbsp;сексе втроем часто стоит желание двойного проникновения, которое можно легко реализовать, не&nbsp;прибегая к&nbsp;помощи третьей стороны.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span style=\"font-family:&quot;Calibri Light&quot;,sans-serif\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><b><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Освоить все 5&nbsp;языков любви</span></span></b></span></span></span></span></span></span></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">В&nbsp;разговоре следует понимать одну простую вещь&nbsp;&mdash; за&nbsp;рамками делового общения мы&nbsp;воспринимаем всю информацию через призму языка любви, на&nbsp;котором говорим сами, и&nbsp;он&nbsp;у&nbsp;каждого человека свой. Об&nbsp;этом ты&nbsp;уже наверняка слышала.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Существует 5&nbsp;основных языков любви: слова одобрения, качественное время, получение подарков, акты служения, физические прикосновения. В&nbsp;идеале нужно использовать все 5&nbsp;языков, чтобы партнер на&nbsp;все сто процентов чувствовал любовь и&nbsp;всегда правильно тебя понимал. Поэтому для того чтобы донести до&nbsp;партнера мысль о&nbsp;желанной фантазии, лучше говорить на&nbsp;понятном ему языке. Это&nbsp;же, кстати, касается вообще любых просьб и&nbsp;серьезных разговоров.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Например,&nbsp;</span></span></span><strong><span style=\"border:none windowtext 1.0pt; font-family:&quot;Arial&quot;,sans-serif; padding:0cm\"><span style=\"color:black\">если язык любви твоего партнера&nbsp;&mdash; подарки</span></span></strong><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">, преподнеси ему что-нибудь, что намекало&nbsp;бы на&nbsp;твою фантазию. Например, наручники или маску. Это должен быть сюрприз, который удивит партнера. Обязательно упакуй подарок и&nbsp;преподнеси его красиво, чтобы у&nbsp;мужчины возникло ощущение праздника.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><strong><span style=\"border:none windowtext 1.0pt; font-family:&quot;Arial&quot;,sans-serif; padding:0cm\"><span style=\"color:black\">Если его язык любви&nbsp;&mdash; это качественное время</span></span></strong><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">, то&nbsp;для него проявлением чувств будет совместная работа над важными для вас обоих вещами. Например, можно предложить ему вместе посетить сеанс тайского массаж для двоих, а&nbsp;потом подкинуть идею продолжить это дома в&nbsp;формате ролевой игры. Или, если ты&nbsp;хочешь попробовать БДСМ, можно посмотреть вместе соответствующий фильм. Если для реализации фантазии нужна атрибутика, то&nbsp;приобретать ее&nbsp;тоже надо вместе. Зайти в&nbsp;секс-шоп можно &laquo;просто так&raquo;, а&nbsp;потом случайно затеряться среди полок. Выбрать что-то вместе обязательно получится.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><strong><span style=\"border:none windowtext 1.0pt; font-family:&quot;Arial&quot;,sans-serif; padding:0cm\"><span style=\"color:black\">Если язык любви мужчины&nbsp;&mdash; физические прикосновения</span></span></strong><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">, то&nbsp;придется сначала дать ему попробовать&nbsp;то, о&nbsp;чем ты&nbsp;говоришь. Например, если речь идет об&nbsp;игрушке, начни с&nbsp;массажера и&nbsp;сделай ему эротический массаж. Очень важно сделать так, чтобы первый опыт мужчины с&nbsp;игрушкой был положительным, чтобы у&nbsp;него остались только хорошие впечатления. За&nbsp;счет этого возникнет желание повторить все проделанное с&nbsp;ним на&nbsp;тебе.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><strong><span style=\"border:none windowtext 1.0pt; font-family:&quot;Arial&quot;,sans-serif; padding:0cm\"><span style=\"color:black\">Если&nbsp;же язык любви связан с&nbsp;актами служения</span></span></strong><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">, то&nbsp;важный разговор о&nbsp;реализации своих замыслов можно начать, например, с&nbsp;приготовленного своими руками завтрака.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><span style=\"color:black\">Акты служения как знаки внимания хороши и&nbsp;до&nbsp;процесса донесения до&nbsp;мужчины ваших сексуальных желаний, и&nbsp;после. Например, шикарный завтрак, приготовленный после бурной ночи, во&nbsp;время которой вы&nbsp;оба получили удовольствие, будет прекрасным закреплением результата.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm 0cm 8pt; margin-right:0cm; margin-left:0cm\">&nbsp;</p>', '2019-07-27 07:36:56', '2019-07-29 17:35:39');
INSERT INTO `articles` (`id`, `enable`, `title`, `url`, `image`, `fullimage`, `desc`, `text`, `created_at`, `updated_at`) VALUES
(4, 1, '5 главных мифов о  женской мастурбации', '5-glavnih-mifov-o-zhenskoy-masturbacii-4', 'pic15634413801ca621dd2b55ce1af04c3b3a01abba7e.jpg', 'pic15634413816d1b2a10b80d5cbb1341ecd9a469470e.jpg', 'За долгие годы, пока женская мастурбация считалась греховной и запретной, этот процесс оброс тонной мифов, часть из которых до сих пор продолжает жить. Вместе с экспертами центра семейного и сексуального образования Secrets вспоминаем распространенные заблуждения о женской мастурбации, которые можно услышать и сейчас.', '<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><u><em><strong><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span calibri=\"\" light=\"\" style=\"font-family:\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Миф 1: мастурбация ведет к&nbsp;потере чувствительности</span></span></span></span></span></span></span></span></strong></em></u></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Уж&nbsp;не&nbsp;знаем, на&nbsp;чем основан этот миф, но&nbsp;в&nbsp;случае с&nbsp;чувствительностью мастурбация действует как раз наоборот, развивая и&nbsp;повышая&nbsp;ее.<br />\r\nСуществуют даже специальные техники по&nbsp;пробуждению эрогенных зон.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Согласно одной из&nbsp;них, мастурбация дает женщине полное понимание того, как работает ее&nbsp;тело, как отзываются конкретные его части на&nbsp;ласки&nbsp;и, в&nbsp;частности, что вообще нужно делать с&nbsp;телом для того, чтобы женщина испытала оргазм.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Более того, мастурбация позволяет разбудить те&nbsp;зоны, которые находились в&nbsp;спящем состоянии, например, зона&nbsp;G, которая есть у&nbsp;каждой женщины, но&nbsp;полностью пробуждена только у&nbsp;некоторых из&nbsp;них. Пробуждена&nbsp;&mdash; значит, способна передавать сигнал о&nbsp;возбуждении в&nbsp;головной мозг; за&nbsp;это в&nbsp;нашем организме отвечают нейронные связи, укреплять которые в&nbsp;случае с&nbsp;чувствительной зоной на&nbsp;передней стенке влагалища помогает именно мастурбация.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">К&nbsp;тому&nbsp;же глупо считать самоудовлетворением исключительно те&nbsp;манипуляции, которые производятся непосредственно над влагалищем. Это&nbsp;&mdash; очень чувственный процесс, в&nbsp;который включаются и&nbsp;ласки всего тела, начиная от&nbsp;головы и&nbsp;заканчивая кончиками пальцев.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Поэтому, если тебя и&nbsp;твои руки до&nbsp;сих пор сковывает страх о&nbsp;потере чувствительности (благо не&nbsp;о&nbsp;волосатых ладошках), пора раз и&nbsp;навсегда прогнать его из&nbsp;своей жизни.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><u><em><strong><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span calibri=\"\" light=\"\" style=\"font-family:\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Миф&nbsp;2: мастурбация снижает шансы на&nbsp;оргазм во&nbsp;время секса с&nbsp;проникновением</span></span></span></span></span></span></span></span></strong></em></u></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Этот миф&nbsp;&mdash; практически родственник первого. Только вот в&nbsp;данном случае речь идет скорее о&nbsp;появлении зависимости от&nbsp;мастурбации (руками или с&nbsp;помощью игрушки&nbsp;&mdash; разницы нет), на&nbsp;фоне которой получить оргазм во&nbsp;время секса с&nbsp;партнером становится все сложнее и&nbsp;сложнее.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Действительно, если при мастурбации, например, долгое время стимулировать только клитор, то&nbsp;при обычном вагинальном сексе без дополнительной стимуляции клитора дойти до&nbsp;пика будет немного сложнее.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Хорошая новость в&nbsp;том, что такая ситуация будет актуальна только первое время и&nbsp;только по&nbsp;причине того, что нейронная связь клитор-мозг укрепилась, а&nbsp;влагалище-мозг отошла на&nbsp;второй план. Такой процесс является обратимым, так что, по&nbsp;сути, никакой зависимости от&nbsp;мастурбации быть не&nbsp;может.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Другое дело, когда речь идет о&nbsp;дезадаптивной мастурбации, то&nbsp;есть о&nbsp;тех действиях, которые необходимы для получения разрядки и&nbsp;которые в&nbsp;то&nbsp;же время нельзя адаптировать к&nbsp;сексу с&nbsp;партнером. Однако с&nbsp;этим тоже можно поспорить: конечно, наш мозг устроен таким образом, что любое поведение, если его повторить энное количество раз, запоминается и&nbsp;воспроизводится им&nbsp;в&nbsp;следующий раз быстрее и&nbsp;точнее, но, справедливости ради, стоит сказать, что чем чаще и&nbsp;большим количеством способов воздействия стимулируется зона отвечающая за&nbsp;удовольствие, тем она становится активнее и&nbsp;восприимчивее ко внешнему воздействию.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Единственное, что нужно знать об&nbsp;опасностях мастурбации с&nbsp;помощью душа, главное&nbsp;&mdash; не&nbsp;переборщить с&nbsp;температурой.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><u><em><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span calibri=\"\" light=\"\" style=\"font-family:\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><b><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Миф&nbsp;3: женщины мастурбируют только тогда, когда их&nbsp;не&nbsp;устраивает их&nbsp;сексуальная жизнь</span></span></b></span></span></span></span></span></span></em></u></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Это как если&nbsp;бы мы&nbsp;пили только тогда, когда испытываем жажду, а&nbsp;не&nbsp;всякий раз, когда просто хотим пить. На&nbsp;самом деле присутствие мастурбации в&nbsp;жизни женщины вовсе не&nbsp;говорит о&nbsp;качестве ее интимной жизни. Даже женщины (как, впрочем, и&nbsp;мужчины), которые имеют регулярный и&nbsp;качественный секс со&nbsp;своим партнером, могут мастурбировать просто потому, что они этого хотят.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Собака может быть зарыта в&nbsp;половой конституции&nbsp;&mdash; если она сильная, значит, и&nbsp;либидо будет находиться на&nbsp;высоком уровне, соответственно, потребность в&nbsp;сексе или мастурбации будет такой&nbsp;же высокой. Будучи в&nbsp;отношениях, мастурбация может быть необходима женщине как способ снять стресс или избавиться от&nbsp;излишней возбудимости.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><u><em><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span calibri=\"\" light=\"\" style=\"font-family:\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><b><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Миф&nbsp;4: чем старше женщина, тем меньше она мастурбирует</span></span></b></span></span></span></span></span></span></em></u></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Связь между возрастом и&nbsp;либидо действительно существует&nbsp;&mdash; с&nbsp;возрастом сексуальное желание женщины может снижаться&nbsp;&mdash; это обусловлено переменами в&nbsp;гормональном фоне.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Но&nbsp;не&nbsp;стоит забывать, что в&nbsp;отличие от&nbsp;мужчин женщины способны получать сексуальное удовольствие хоть до&nbsp;самой смерти. Клитор, родной-любимый, он&nbsp;же никуда не&nbsp;девается! И, что самое удивительное, клитор&nbsp;&mdash; это единственный орган, функционал которого заключается исключительно в&nbsp;том, чтобы приносить женщине удовольствие.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Так что заявление о&nbsp;том, что женщины в&nbsp;возрасте мастурбируют реже молодых,&nbsp;&mdash; это скорее чье-то снисходительное мнение. На&nbsp;деле&nbsp;же все зависит от&nbsp;желания конкретной женщины испытывать удовольствие и&nbsp;получать оргазмы.</span></span></span></span></span></span></span></p>\r\n\r\n<h2 style=\"margin-top:0cm; margin:2pt 0cm 0.0001pt\"><u><em><span style=\"font-size:13pt\"><span style=\"background:white\"><span style=\"line-height:24.0pt\"><span calibri=\"\" light=\"\" style=\"font-family:\"><span style=\"color:#2e74b5\"><span style=\"font-weight:normal\"><b><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Миф&nbsp;5: частая мастурбация вредит здоровью</span></span></b></span></span></span></span></span></span></em></u></h2>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Все мы&nbsp;разные, и&nbsp;каждой из&nbsp;нас требуется своя &laquo;доза&raquo;. Кому-то нужно меньше, а&nbsp;кому-то больше. Нормы в&nbsp;этом вопросе не&nbsp;существует и&nbsp;&laquo;слишком много&raquo;&nbsp;&mdash; это понятие очень относительное. Вообще, мастурбация&nbsp;&mdash; это самая безопасная форма секса, в&nbsp;процессе ты&nbsp;не&nbsp;рискуешь забеременеть или заразиться половой инфекцией.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Другое дело, когда желание мастурбировать мешает, например, работе или негативно сказывается на&nbsp;личной жизни.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Что касается физиологии вопроса&nbsp;&mdash; навредить себе частой мастурбацией ты&nbsp;можешь только тогда, когда слишком увлечешься&nbsp;и, забывшись в&nbsp;порыве страсти, нанесешь себе механические повреждения.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Дело в&nbsp;том, что слизистая влагалища&nbsp;&mdash; очень нежная, а&nbsp;клитор, если не&nbsp;нежнее, то&nbsp;тоже где-то на&nbsp;уровне. Поэтому слишком агрессивная или чересчур продолжительная стимуляция может привести к&nbsp;раздражению или даже микротрещинам.</span></span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin:0cm; margin-bottom:.0001pt; margin-right:0cm; margin-left:0cm\"><span style=\"font-size:12pt\"><span style=\"background:white\"><span style=\"line-height:18.0pt\"><span new=\"\" roman=\"\" style=\"font-family:\" times=\"\"><span style=\"font-size:13.0pt\"><span arial=\"\" style=\"font-family:\"><span style=\"color:black\">Для того чтобы свести на&nbsp;нет такие неприятности, всегда используй лубрикант и&nbsp;следи за&nbsp;состоянием своих ногтей или игрушки.</span></span></span></span></span></span></span></p>', '2019-07-27 07:37:52', '2019-07-29 17:30:36'),
(5, 0, 'Тестовая статья', 'testovaya-statya-5', 'pic15634413801ca621dd2b55ce1af04c3b3a01abba7e.jpg', 'pic15634413816d1b2a10b80d5cbb1341ecd9a469470e.jpg', 'Мы предоставляем консультацию по \r\nвыбору покрытий и инструментов, \r\nспособов нанесения и обработки \r\nповерхностей, исходя из Ваших \r\nпотребностей.', '<p>С другой стороны укрепление и развитие структуры представляет собой интересный эксперимент проверки системы обучения кадров, соответствует насущным потребностям. Идейные соображения высшего порядка, а также консультация с широким активом требуют от нас анализа соответствующий условий активизации. Идейные соображения высшего порядка, а также консультация с широким активом в значительной степени обуславливает создание позиций, занимаемых участниками в отношении поставленных задач. Товарищи! постоянный количественный рост и сфера нашей активности способствует подготовки и реализации модели развития.</p>\r\n\r\n<p>Повседневная практика показывает, что дальнейшее развитие различных форм деятельности представляет собой интересный эксперимент проверки позиций, занимаемых участниками в отношении поставленных задач. Значимость этих проблем настолько очевидна, что постоянное информационно-пропагандистское обеспечение нашей деятельности требуют от нас анализа форм развития. Идейные соображения высшего порядка, а также рамки и место обучения кадров требуют от нас анализа направлений прогрессивного развития. Значимость этих проблем настолько очевидна, что дальнейшее развитие различных форм деятельности представляет собой интересный эксперимент проверки систем массового участия. С другой стороны реализация намеченных плановых заданий требуют от нас анализа соответствующий условий активизации. Идейные соображения высшего порядка, а также постоянный количественный рост и сфера нашей активности позволяет оценить значение систем массового участия.</p>', '2018-07-27 07:38:45', '2019-07-29 17:31:02');
