(236, 43, 'Набор БДСМ (10 предметов)', 'Эротический набор для бдсм игр 10 предметов выполненных из высококачественной искусственной кожи. Набор подобран таким образом, чтобы bdsm сессия с его применением была максимально приятна для всех ее участников. Наручники, оковы на ноги, кляп, ошейник с поводком и даже веревка - это фиксаторы благодаря которым возбуждение будет нарастать ещё в процессе одевания. Зажимы для сосков, плеть и стик с пером - это лучшие предметы для наказания и пыток непослушного и уже очень возбужденного раба. Фантазировать и воплощать в жизнь свои самые смелые желания одно наслаждение. ', 0, 'B-ASM1', 10000, 0, 'черный', 'Искусственная кожа', '/goods_files/BDSM/B-ASM1/10690098978_766905144.jpg', 'В наличии', 'nabor-bdsm-10-predmetov-236', 1, 41, 'woman', 0, '2019-07-28 10:45:01', '2019-07-28 13:45:21'),
(237, 43, 'Набор БДСМ (10 предметов)', 'Эротический набор для бдсм игр 10 предметов выполненных из высококачественной искусственной кожи с леопардовым принтом. Набор подобран таким образом, чтобы bdsm сессия с его применением была максимально приятна для всех ее участников. Наручники, оковы на ноги, кляп, ошейник с поводком и даже веревка - это фиксаторы благодаря которым возбуждение будет нарастать ещё в процессе одевания. Зажимы для сосков, плеть и стик с пером - это лучшие предметы для наказания и пыток непослушного и уже очень возбужденного раба. Фантазировать и воплощать в жизнь свои самые смелые желания одно наслаждение. ', 0, 'B-ASM2', 11000, 0, 'леопардовая расцветка', 'Искусственная кожа', '/goods_files/BDSM/B-ASM2/9339199446_2054496363.png', 'В наличии', 'nabor-bdsm-10-predmetov-237', 1, 98, 'woman', 0, '2019-07-28 10:45:01', '2019-07-28 13:48:28'),
(238, 43, 'Набор БДСМ (8 предметов)', 'Садо мазо набор состоит из 8 предметов выполненного из искусственной кожи с меховой опушкой. Набор подобран таким образом, чтобы бдсм сессия с его применением была максимально приятна для всех ее участников. Наручники, кляп, ошейник и даже веревка - это фиксаторы благодаря которым возбуждение будет нарастать ещё в процессе одевания.  Фантазировать и воплощать в жизнь свои самые смелые желания одно наслаждение.', 0, 'B-ASM3', 8000, 0, 'черный', 'Искусственная кожа', '/goods_files/BDSM/B-ASM3/1.png', 'В наличии', 'nabor-bdsm-8-predmetov-238', 1, 80, 'woman', 0, '2019-07-28 10:45:02', '2019-07-28 13:45:23'),
(239, 44, 'Секс поддержка для ног', 'Это приспособление для секса выполнено из искусственной кожи с металлическими клепками. Главное приспособление этой секс поддержки - зафиксировать ноги в приподнятом положении, что придает позе большей откровенности и доступности. \nОпустить ноги или спрятать интимные места от ласк в таком фиксаторе просто невозможно.', 0, 'B-ASM4', 5000, 0, 'черный', 'Искусственная кожа', '/goods_files/BDSM/B-ASM4/4205367475_1787528409.jpg', 'В наличии', 'seks-podderzhka-dlya-nog-239', 1, 100, 'woman', 0, '2019-07-28 10:45:02', '2019-07-28 13:45:24'),
(240, 44, 'Бондаж рук с ошейником', 'Фиксатор рук за спиной с ошейником хороший девайс для воспитания непослушных рабов. Ошейник \"поставит на место\" а наручники за спиной не позволят рукам двигаться, прикасаться к себе, ласкать.', 0, 'B-ASM5', 5000, 0, 'черный', 'Экокожа', '/goods_files/BDSM/B-ASM5/10540809466_837214206.jpg', 'В наличии', 'bondazh-ruk-s-osheynikom-240', 1, 37, 'woman', 0, '2019-07-28 10:45:02', '2019-07-28 13:45:21'),
(241, 44, 'Комплект ремней для распятия', 'Регулируемые по размеру наручники и поножи, соединенные ремнями с возможностью изменения длины для \"распятия\" партнера.', 0, 'B-ASM6', 6000, 0, 'черный', 'неопрен', '/goods_files/BDSM/B-ASM6/8962224991_1753295657.jpg', 'В наличии', 'komplekt-remney-dlya-raspyatiya-241', 1, 99, 'woman', 0, '2019-07-28 10:45:02', '2019-07-28 13:48:28'),
(242, 45, 'Ошейник с прищепками для сосков', 'Ошейник с прищепками для возбуждения сосков во время секса с резиновыми чехольчиками на концах. Клипсы надежно фиксируются и придадут вашим интимным играм не только изысканности и игривости, но и приятное возбуждение, граничащее с болью. Ошейник, в свою очередь покорит и подчинит своей власти.', 0, 'B-ASM7', 4000, 0, 'черный', 'Экокожа', '/goods_files/BDSM/B-ASM7/10792108221_1150792373.jpg', 'В наличии', 'osheynik-s-prishhepkami-dlya-soskov-242', 1, 87, 'woman', 0, '2019-07-28 10:45:02', '2019-07-28 13:49:15'),
(243, 44, 'Качели на дверь для секса', 'Секс качели.\r\nНевероятный аксессуар, который позволяет экспериментировать с самыми необычными позами и получать неизведанное ранее удовольствие от секса. \r\nПростые в установке – для них нужна всего-лишь обычная дверь. Качели крепятся на акриловых трубках, а дверь запирается. Желательно ее зафиксировать на замок или задвижку. Отрегулируйте длину строп как Вам необходимо, и они готовы к использованию! \r\nУдобные петли для рук и ног помогут крепко удержаться и фантазировать с новыми позами. \r\nСекс качели - этот роскошный секс-аттракцион поможет сделать массу открытий в сексе и испытать свежие эмоции. \r\nКачели выдерживают вес до 150 кг.', 0, 'B-ASM8', 10000, 0, 'черный', 'Полиэстер', 'pic1564486362463a898d35bd5d3f496d5308b10de7ca.jpg', 'В наличии', 'kacheli-na-dver-dlya-seksa-243', 1, 243, 'woman', 0, '2019-07-28 10:45:02', '2019-07-30 11:32:55'),
(244, 46, 'Зажими для сосков', 'Зажимы для возбуждения сосков во время секса с резиновыми чехольчиками на концах. Клипсы со звенящими бубенцами придадут вашим интимным играм не только изысканности и игривости, но и приятное возбуждение, граничащее с болью.\n\nСтепень сжатия зажимов регулируется с помощью специального винта.', 0, 'B-ASM9', 1000, 0, 'разные цвета', 'металл', '/goods_files/BDSM/B-ASM9/2468657499_36457125.jpg', 'В наличии', 'zazhimi-dlya-soskov-244', 1, 72, 'woman', 0, '2019-07-28 10:45:02', '2019-07-28 13:45:15'),
(245, 48, 'Наручники с мехом', 'Кожаные оковы – прекрасная альтернатива холодным железным браслетам. \r\nКожа приятна на ощупь, и очень стильно смотрится на запястьях. Мех с внутренней стороны не позволит оставить следа на запасьях', 0, 'B-ASM10', 5000, 0, 'черный', 'Экокожа', 'pic15644864708996db33afcc6e5c8fae2f63961ee2ea.jpg', 'В наличии', 'naruchniki-s-mehom-245', 1, 245, 'woman', 0, '2019-07-28 10:45:02', '2019-07-30 11:34:44'),
